import React, { useState } from 'react';
import { motion, AnimatePresence } from 'framer-motion';
import styled from 'styled-components';
import CHCWorkforceDashboard from './chc-workforce/CHCWorkforceDashboard';
import PregnancyCareAnalysis from './chc-workforce/PregnancyCareAnalysis';
import WorkforceGrowthAnalysis from './chc-workforce/WorkforceGrowthAnalysis';
import TelehealthAnalysis from './chc-workforce/TelehealthAnalysis';
import ProviderTypeBreakdown from './chc-workforce/ProviderTypeBreakdown';
import GeographicDistribution from './chc-workforce/GeographicDistribution';
import PolicyImplications from './chc-workforce/PolicyImplications';
import DataExplorer from './chc-workforce/DataExplorer';
import CHCHeader from './chc-workforce/CHCHeader';
import CHCNavigation from './chc-workforce/CHCNavigation';

const AppContainer = styled.div`
  min-height: 100vh;
  background: linear-gradient(135deg, #0f766e 0%, #0d9488 100%);
`;

const ContentContainer = styled.div`
  max-width: 1200px;
  margin: 0 auto;
  background: white;
  box-shadow: 0 0 50px rgba(0,0,0,0.2);
  border-radius: 12px;
  overflow: hidden;
  position: relative;
`;

const TabContent = styled(motion.div)`
  min-height: 80vh;
`;

const sections = [
  { id: 'dashboard', label: 'Executive Dashboard', icon: 'ðŸ“Š' },
  { id: 'workforce-growth', label: 'Workforce Growth', icon: 'ðŸ“ˆ' },
  { id: 'provider-types', label: 'Provider Types', icon: 'ðŸ‘¥' },
  { id: 'pregnancy-care', label: 'Pregnancy Care', icon: 'ðŸ¤±' },
  { id: 'telehealth', label: 'Telehealth Usage', icon: 'ðŸ’»' },
  { id: 'geographic', label: 'Geographic Distribution', icon: 'ðŸ—ºï¸' },
  { id: 'policy', label: 'Policy Implications', icon: 'ðŸ›ï¸' },
  { id: 'explorer', label: 'Data Explorer', icon: 'ðŸ”¬' }
];

const CHCWorkforceApp = () => {
  const [activeSection, setActiveSection] = useState('dashboard');

  const renderContent = () => {
    switch (activeSection) {
      case 'dashboard':
        return <CHCWorkforceDashboard />;
      case 'workforce-growth':
        return <WorkforceGrowthAnalysis />;
      case 'provider-types':
        return <ProviderTypeBreakdown />;
      case 'pregnancy-care':
        return <PregnancyCareAnalysis />;
      case 'telehealth':
        return <TelehealthAnalysis />;
      case 'geographic':
        return <GeographicDistribution />;
      case 'policy':
        return <PolicyImplications />;
      case 'explorer':
        return <DataExplorer />;
      default:
        return <CHCWorkforceDashboard />;
    }
  };

  return (
    <AppContainer>
      <ContentContainer>
        <CHCHeader />
        <CHCNavigation 
          sections={sections}
          activeSection={activeSection}
          onSectionChange={setActiveSection}
        />

        <AnimatePresence mode="wait">
          <TabContent
            key={activeSection}
            initial={{ opacity: 0, x: 300 }}
            animate={{ opacity: 1, x: 0 }}
            exit={{ opacity: 0, x: -300 }}
            transition={{ duration: 0.5, ease: "easeInOut" }}
          >
            {renderContent()}
          </TabContent>
        </AnimatePresence>
      </ContentContainer>
    </AppContainer>
  );
};

export default CHCWorkforceApp;
